const CONTENT = ["abcdcdcdc", "dfdfsdfsf", "dfdsfsdf"];
const SearchContent = () => {
  return (
    <>
      {CONTENT.length > 0 &&
        CONTENT.map((el, index) => {
          return <li key={index}>{el}</li>;
        })}
    </>
  );
};
export default SearchContent;
